import React, {useState} from 'react'
import './portfolio.css'
import CollectPayouts from './CollectPayout'

const PPayouts = () => {

    const [show, setShow] = useState(false)

    const hide = () => {
        setShow(false)
    }

    return(
        <div className='PPayouts'>
            <div className="p-payouts-div">
                <button onClick={()=>{setShow(!show)}} className="p-payouts-btn">Collect Win Payouts (2)</button>
            </div>
            {show && <><CollectPayouts hide={hide} /></>}
        </div>
    )
}

export default PPayouts
